def shipWithinDays(weights: 'List[int]', D: int):
    upper = sum(weights)
    lower = max(weights)
    #the purpose is to find the minimum number between upper and lower that can partition the group < D.
    #use binary search.
    w = (upper+lower )//2
    while lower <= upper :
        curr = 0
        i = 0
        grp_cnt = 0
        while i<len(weights):
            curr+=weights[i]
            if curr > w:
                grp_cnt +=1
                curr = 0
            elif curr == w:
                grp_cnt += 1
                i+=1
                curr = 0
            else:
                i+=1

        grp_cnt += 1 if curr != 0 else 0

        if grp_cnt <= D:
            upper = w-1
            good = w # in case the w does not fit in the last case. the "good" preserve the last working value.
        else:
            lower = w+1

        w = (lower+upper)//2

    return good

